function Gamealgo()
{
    let arrObj={
      arr1:new Array(5),
      arr2:new Array(5),
      arr3:new Array(5),
      arr4:new Array(5),
      arr5:new Array(5),
      arr6:new Array(5),
      arr7:new Array(5),
      arr8:new Array(5)
    }
    arrObj.arr1[0]="A"
    arrObj.arr2[2]="c"
    console.log(arrObj.arr1[0]+" "+arrObj.arr2[2]);
}
export default Gamealgo
